import favLine from "./favLine"



function myFav(props){

    return(

<div>
<h1>My Favorite pets</h1>
{props.favList.map(x=> <favLine id={x.id} img={x.photo} animalName={x.animalName} size={x.size} status={x.status}></favLine> )}



</div>


)}

export default myFav
